float sigmoid(float num) {
    return 1 / (1 + exp(-num));
}

float step(float num) {
    if (num < 0) {
        return 0;
    }
    return 1;
}

float relu(float num) {
    if (num > 0) {
        return num;
    } else {
        return 0;
    }
}

float linear(float num) {
    return num;
}

void layer(float * in, float * layer_weight, float * layer_bias,   
            int row, int col, float * output, int use_activation) {
    int ii;
    int jj;
    float * p;

    for(ii = 0; ii < col; ii++) {
        p = layer_weight + ii;
        output[ii] = 0;
        for (jj = 0; jj < row; jj++) {
            output[ii] += in[jj] * (*p); 
            p += col;
        }
        output[ii] += layer_bias[ii];

        if (use_activation == 1) {
			output[ii] = relu(output[ii]);
        }
    }
}

